import ActionButtons from "./ActionButton";
import nutriRatioImg from "../assets/nutriRatio.png";
import "../views/views.css";
const SingleType = ({
  config: { _id, type, TDS, dead_TDS, PH, dead_PH, nutri_Ratio },
}) => (
  <div className="singleType">
    <div className="value">
      <div className="typeSetting">{type}</div>
      <img src={nutriRatioImg}></img>
      <div className="TDSSetting">TDS: {TDS}</div>
      <div className="dead_TDSSetting">dead_TDS: {dead_TDS}</div>
      <div className="PHSetting">PH: {PH}</div>
      <div className="dead_PHSetting">dead_PH: {dead_PH}</div>
      <div className="nutri_ratioSetting">Nutri Ratio: {nutri_Ratio}</div>
    </div>

    <ActionButtons
      _id={_id}
      type={type}
      TDS={TDS}
      dead_TDS={dead_TDS}
      PH={PH}
      dead_PH={dead_PH}
      nutri_Ratio={nutri_Ratio}
      className="actionButton"
    />
  </div>
);

export default SingleType;
